INSERT INTO `tbl_articles` VALUES (29,'1. Learn where to find the cheap gas.',1,'txt','It is best to avoid affluent areas when looking for a cheap fill. People in these areas are less price sensitive, and the gas stations\r\nrealize this fact. Gas at a station near major freeway exists can be more expensive than at stations farther away. It can pay to drive a\r\nfew blocks from the freeway to find a deal.',0,9,'','','',1),(30,'2. Search online or use your Smartphone.',1,'txt','There are many internet sites and apps ready to help you find the cheapest gas prices. Take the time to search for the cheapest gas before filling the tank.',1,9,'','','',1),(31,'3. Change the way you drive.',1,'txt','Many people burn much more gas than they have to. By making a few small\r\nadjustments in the way you drive, you can gain considerable fuel savings. Most vehicles today are set to achieve optimal fuel economy around 55mph. If you drive too fast or too slow, you won\'t be able to maximize your fuel savings. Also, don\'t accelerate or brake too hard - this is very hard on fuel economy.',2,9,'','','',1),(32,'4. Find the right type of station.',1,'txt','Some stations are always the price leaders in the area. Often times wholesale clubs, grocery stores or department stores with gas stations will sell gas close to cost or at a loss (loss leader), in order to get people into the stores where they may buy other, higher margin items. Some of these places require memberships. The cost of the membership must be factored into the price. Some of these stations also give you a\r\ncredit for in store purchases when you fill up with gas. This can result in considerable indirect savings. Service stations with an auto repair shop on site often have more expensive gas.',3,9,'','','',1),(33,'5. Find other ways to get to work.',1,'txt','-One of the best ways to lower your fuel cost is to carpool to work. You can reduce the inconvenience by sharing a ride with someone who works at the same company, and lives near your home. Many companies have a bulletin board or Intranet web site where you may be able to find someone to carpool with. \r\n-Another great option is public transportation. Passes are usually available at discounted rates. Although you have to pay to use public transportation, it is usually much less expensive than driving to work, and paying for parking (where applicable).\r\n-Some other options are walking or riding a bike to work. Both of these options have the added benefit of giving you exercise; however, you must live relatively close to work to be able to do this, and you are well advised to ensure that you have access to a shower at work.',4,9,'','','',1),(34,'Where can I get the printed Bus Routes?',1,'txt','Printed Bus Route timetables and maps are available at the following locations:\r\n\r\n1 Broward County libraries\r\n2 Broward Central Bus Terminal\r\n3 Broward County Governmental Center\r\n4 Most check cashing stores\r\n5 Broward County Transit Administration Office complex (Broward\r\nBoulevard and NW 1 Ave., Fort Lauderdale)\r\n6 Broward County Transit Rider Info line at 954-357-8400\r\n7 Hearing-speech impaired/TTY call (954) 357-8302 (teletype machine\r\nrequired)',0,11,'','','',1),(35,'Where can I purchase a Broward County Transit bus pass?',1,'txt','You may purchase BCT Bus Passes at many conveniently located outlets including:\r\n\r\n1 BCT Central Terminal (Broward Boulevard and NW 1 Ave., Fort Lauderdale)\r\n2 Most Broward County libraries\r\n3 Various check cashing stores\r\n4 College Bus Pass can only be purchased at the BCT Central Terminal, at selected libraries and on some College campuses.\r\n5 Premium 31-Day and Premium 10 Ride Bus Passes can only be purchased at the BCT Central Terminal\r\n6 Broward County library locations do not accept credit or debit cards for bus pass purchase.',3,11,'','','',1),(36,'What are the costs of BCT bus passes?',1,'txt','It depends on your pass. You may purchase an all day pass, 10 ride pass, 7 day pass, 31 day pass, reduced fare pass for seniors, youth, people with disabilities, Medicare and college students. You may also purchase a 95 Express Premium 10-Ride or 31-day pass.',1,11,'','','',1),(37,'Who is eligible for a reduced fare?',1,'txt','Broward County Transit offers reduced fares to make it easier for youth, seniors, college students and those with disabilities or on Medicare.',4,11,'','','',1),(38,'How do I get the Reduced Fare Photo Identification Card? What do I need to bring with me?',1,'txt','Photo sessions for the I.D. card are held at the Broward Central Terminal, Broward Boulevard and N.W. 1st Avenue, downtown Fort Lauderdale. Photos are taken and cards issued Monday thru Friday, 8:30 am to 4:30 pm.',2,11,'','','',1),(39,'What is Paratransit (TOPS)?',1,'txt','Paratransit (TOPS), also known as TOPS â€“ Transportation Options is for persons with a physical, cognitive, emotional, visual or other disability which functionally prevents them from using a Broward County Transit fixed route. To qualify, each applicant must go through an eligibility determination process.\r\n\r\nApplicants seeking ADA Paratransit (TOPS) are strongly encouraged to contact Customer Service at 954-357-8400 to discuss the eligibility criteria and other transportation options available through the TOPS program. Disability alone does not confirm eligibility for ADA Paratransit (TOPS). An in-person functional assessment is required, in most cases, to complete the eligibility process',0,12,'','','',1),(40,'If I use Paratransit (TOPS), can I use the â€œregularâ€ bus service?',1,'txt',' - Paratransit has developed a free program to help clients use the Fixed Route bus service. A professional instructor provides personal and group lessons at no charge to teach riders how to use county buses. Paratransit eligible riders can learn to travel the fixed route bus service by calling 954.357.7705.\r\n - Free Use of Fixed-Route Service\r\n - Any registered Paratransit rider with current eligibility may use the fixed-route service free of charge. The use of the fixed-route benefit will not impact Paratransit eligibility.',1,12,'','','',1),(93,'Florida KidCare',1,'txt','<p>Through Florida KidCare, the State of Florida offers health insurance for children from birth through age 18, even if one or both parents are working. It includes four different parts. When you apply for the insurance, Florida KidCare will check which part your child may qualify for based on age and family income.&nbsp; <a>http://www.floridakidcare.org/</a></p>\r\n<ul>\r\n<li><a title=\"Florida Kidcare Partners\" href=\"http://www.floridakidcare.org/partners.html\" target=\"_blank\">MEDIKIDS</a>: children ages 1 through 4.</li>\r\n<li>HEALTHY KIDS: children ages 5 through 18. non-Medicaid monthly premiums</li>\r\n<li>CHILDREN&rsquo;S MEDICAL SERVICES NETWORK: children birth through 18 who havespecial health care needs.</li>\r\n<li>MEDICAID: children birth through 18. For low income or disabilities. Medical andBehaviorial Health. A child who has other health insurance may still qualify for Medicaid.</li>\r\n</ul>\r\n<p>Some of the services Florida KidCare covers are:</p>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Doctor visits</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>Check-ups and shots</td>\r\n<td>Emergencies</td>\r\n</tr>\r\n<tr>\r\n<td>Hospital</td>\r\n<td>Vision and hearing</td>\r\n</tr>\r\n<tr>\r\n<td>Surgery</td>\r\n<td>Dental</td>\r\n</tr>\r\n<tr>\r\n<td>Prescriptions</td>\r\n<td>Mental health</td>\r\n</tr>\r\n</tbody>\r\n</table>',0,30,'','','',1),(91,'What to considerâ€¦',1,'txt','<ul>\r\n<li>Length of time expected to be in the area</li>\r\n<li>Renting requires a first, last and security payment</li>\r\n<li>Local prices (Is it worth buying right now?)</li>\r\n<li>Owning a home requires a down payment</li>\r\n<li>Cost besides the mortgage of the home (Insurance, taxes, home owner association fees)</li>\r\n</ul>',0,29,'','','',1),(92,'Whatâ€™s your debt to income ratio??',1,'txt','<p>51% &amp; above - Danger! Your debt to income ratio is at an extremely high level</p>\r\n<p>39%-50% - High! Your debt to income ratio is at a high level.</p>\r\n<p>24%-38% - Fair! Although your debt to income ratio is at an acceptable level, you are still using a sizable amount to service debts.</p>\r\n<p>16%-23% - Good! Your debt to income ratio is at a safe level. You can focus on eliminating any high interest debts.</p>\r\n<p>15% &amp; below - Great!! You have a very low debt to income ratio!</p>',1,29,'','','',1),(94,'What to provide with your application for Medicaid',1,'txt','<p>What is Medicaid? Medicaid is a state run medical assistance program for needy individuals and families with limited income.<br>Who qualifies?</p>\r\n<p>If you are under age 65 and have no children, you must be disabled to qualify for Medicaid.</p>\r\n<ul>\r\n<li>You may be disabled if you have a condition that has affected (or is expected to affect) your ability to work for at least 12 full months, or result in death.</li>\r\n<li>Children may be considered disabled if they have a medical condition severe enough to be considered a disability for an adult.</li>\r\n<li>Who decides if I am disabled? We use the same rules as Social Security to determine disability. If Social Security determines you are disabled, we accept their decision and will automatically consider you disabled. If you do not have a disability determination from Social Security, we will work with the Division of Disability Determinations (DDD) to have them evaluate your condition based on medical information you provide.</li>\r\n</ul>',0,31,'','','',1),(95,'What is the Procedure?',1,'txt','<ul>\r\n<li>Complete the application:\r\n<ul>\r\n<li>File an application online at www.myflorida.com/accessflorida or call 1-866-762-2237 for an application to be mailed .The Department of Children and Families will act on your application without regard to age, race, color, sex, disability, religious creed, national origin, marital status, or political beliefs.</li>\r\n<li>Provide Signed CF-ES 2514 form (Authorization to Disclose Information).</li>\r\n<li>Provide Medical information</li>\r\n</ul>\r\n</li>\r\n<li>Attend an Interview: Don&rsquo;t Delay! Don&rsquo;t delay your interview if you don&rsquo;t have all this information. You can provide it later or we can help you get it. Most interviews are handled by telephone.</li>\r\n<li>Every effort is made to complete your application within 90 days of the date your application for Medicaid is received, not counting any delays caused by you in getting necessary information to us.</li>\r\n<li>If your case is still pending after 100 days, your case will be reviewed to determine why there is no decision, instruct eligibility staff on what information is missing, and advise them how to obtain the missing information. If a100-day review of your case is completed, you will be sent a special notice telling you the results of the review. Your case will continue to be monitored until a final decision is made.</li>\r\n</ul>',1,31,'','','',1),(96,'What do I need to provide?',1,'txt','<ul>\r\n<li>Medical Information:\r\n<ul>\r\n<li>A copy of the letter from Social Security to show the determination of disability and the date your disability began. If Social Security determination letter is received, no other medical information is needed; otherwise medical information will be collected to determine disability eligibility.</li>\r\n<li>Proof you have applied for Social Security Disability Insurance payments.</li>\r\n</ul>\r\n</li>\r\n<li>You must have income and assets within certain limits to qualify:\r\n<ul>\r\n<li>Proof of gross monthly income from all sources,</li>\r\n<li>Information about things you own such as bank accounts, stocks, annuities, real property, cars, etc.</li>\r\n</ul>\r\n</li>\r\n<li>Proof of Florida residency</li>\r\n<li>Proof of U.S. citizenship or qualified noncitizen: Social Security number or Alien registration card, if not a U.S. citizen.</li>\r\n</ul>',2,31,'','','',1),(97,'You Are Your Childâ€™s First Teacher',1,'txt','<p>Many simple everyday occurrences provide excellent opportunities to enhance your child&rsquo;s development. Never underestimate the value of even 15 minutes of quality time spent with your child. Remember, you are your child&rsquo;s first teacher!</p>',0,32,'','','',1),(98,'Talk! Talk! Talk!',1,'txt','<p>From the time of birth, talking to your child has a big impact because language exchange is important to your child&rsquo;s language development.</p>\r\n<p>Here are some tips to encourage your child&rsquo;s use of language:</p>\r\n<ul>\r\n<li>Place a favorite toy out of reach.</li>\r\n<li>Give the child a cookie and give friend 2 cookies.</li>\r\n<li>Say rhymes and let the child fill in the rhyming word.</li>\r\n<li>Encourage counting items.</li>\r\n</ul>',1,32,'','','',1),(99,'Read! Read! Read!',1,'txt','<p>Story reading or story telling is important, as this activity helps the child know the typical pattern of events that one expects to hear in a story.</p>\r\n<p>Here are some tips to encourage your child&rsquo;s use of literacy:</p>\r\n<ul>\r\n<li>Talk about the front of the book, the top of the page. Point to words.</li>\r\n<li>Play games with sounds.</li>\r\n<li>If a book has too many words, tell the story more simply.</li>\r\n<li>Play rhyming games.</li>\r\n<li>Encourage proper pronunciation of words.</li>\r\n<li>Print names and words familiar to the child&rsquo;s environment.</li>\r\n</ul>\r\n<p>Additionally:</p>\r\n<ul>\r\n<li>Give individual attention for five or ten minutes.</li>\r\n<li>Be a good listener.</li>\r\n<li>Follow your child&rsquo;s lead for conversation and enjoyable interaction.</li>\r\n</ul>\r\n<p>When your child shows interest in the alphabet or conversation, follow your child\'s lead. Be<br>creative and use things that are funny and familiar. After all, you are your child&rsquo;s first teacher!</p>',2,32,'','','',1),(100,'Consider Your Options',1,'txt','<p>Your first question should be \"What type of care best meets my child&rsquo;s needs?\"<br>Several types are available outside the home and each offers its own benefits:</p>\r\n<ul>\r\n<li><strong>Child Care Center</strong> Care and educational activities offered to a group of children in a licensed, non-residential setting accommodating more than five children</li>\r\n<li><strong>Family Child Care Home</strong> Care and educational activities offered to a group of five children or less in the home of a person who provides the care. Licensed</li>\r\n<li><strong>School-Age Child Care</strong> Programs for children ages 5 through 12 covering before and after school time; some offer school holiday programs and other times when school is not in session. These may be in schools, child care centers, family child care homes, youth organizations and religious organizations.</li>\r\n<li><strong>Mom and Me Programs</strong> Mom and Me programs are designed to bring parents and their infants or toddlers together. Developmentally appropriate activities are offered to help parents learn more about child development in a social, supportive atmosphere.</li>\r\n<li><strong>Play Groups</strong> Play groups are part-week, part-day programs designed to give toddlers and young preschool children an opportunity for socialization. Programs may be offered by licensed child care centers, by church or temple groups, by local parks and recreation programs, or by parent groups.</li>\r\n<li><strong>Summer Camps</strong> These day camps are offered in public and private schools, child care centers, family child care homes, religious organizations and youth organizations, and through the county and municipalities. Licensing is not required</li>\r\n<li><strong>Head Start/ Voluntary Pre-Kindergarten (VPK)</strong> A high quality program with an early literacy focus. It is free for all children 4 years old on or before September 1st, who reside in Florida.</li>\r\n</ul>',0,33,'','','',1),(101,'Head Start',1,'txt','<p>Head Start is a national, federally-funded program that provides free comprehensive services for low-income preschool children and their families. These services include:</p>\r\n<ul>\r\n<li>Individualized instruction by highly qualified teachers</li>\r\n<li>Developmentally appropriate curriculum that fosters a child&rsquo;s intellectual, emotional and social growth.</li>\r\n<li>Screening and assessment</li>\r\n<li>Field trips</li>\r\n<li>Social services</li>\r\n<li>Medical and dental services</li>\r\n<li>Nutrition services</li>\r\n<li>Services for children with disabilities</li>\r\n<li>Parent involvement</li>\r\n<li>Family and community partnerships</li>\r\n</ul>',0,34,'','','',1),(102,'Eligibility Requirements and Application Procedures',1,'txt','<p>In order to be eligible for a preschool program, the following must apply:</p>\r\n<ul>\r\n<li>the child is 3 to 4 years old on or before September 1,</li>\r\n</ul>\r\n<p>AND</p>\r\n<ul>\r\n<li>family income meets low-income guidelines</li>\r\n</ul>\r\n<p>When applying, the following items are required:</p>\r\n<ul>\r\n<li>Proof of age (example: child\'s ORIGINAL birth certificate)</li>\r\n<li>Proof of ALL household income from the previous year</li>\r\n<li>Child\'s Medicaid card, if eligible</li>\r\n<li>Proof of guardianship, if applicable</li>\r\n<li>Proof of Broward County residency</li>\r\n<li>***Eligibility is based on Income and other factors, NOT on a \"First Come, First Served Basis\".</li>\r\n</ul>',1,34,'','','',1),(103,'Voluntary Pre-Kindergarten',1,'txt','<p><span style=\"text-decoration: underline;\">What is the program?</span> The Voluntary Pre-kindergarten program is designed to prepare Florida\'s children for kindergarten and develop the skills they need to become good readers and successful students. It includes standards for literacy skills, strict accountability, appropriate curricula, substantial instruction periods, manageable class sizes and qualified instructors. The Early Learning Coalition of Broward County, Inc. is administering the Voluntary Pre-kindergarten program at the local level which includes registering child care providers and providing applications and information to parents.</p>\r\n<p><span style=\"text-decoration: underline;\">What are steps to receive services?</span> When you complete the application process, you will receive a Certificate of Eligibility and a list Broward County VPK Providers. You will need to submit the Certificate of Eligibility to the provider you choose, prior to your child attending the program.</p>',2,34,'','','',1),(104,'Choosing Quality Child Care',1,'txt','<p>As a parent, no decision you make will be more important, or more difficult, than choosing a child care situation that best meets your family&rsquo;s needs. We are committed to helping parents find answers to their questions regarding how to locate <span style=\"text-decoration: underline;\">quality</span> child care and other early care and education concerns.</p>\r\n<p><br>Begin by visiting several child care homes and centers. On each visit, think about your first impression and:</p>\r\n<p><strong>Look</strong></p>\r\n<ul>\r\n<li>Does the place look safe for your child?</li>\r\n<li>Do the caregivers/teachers enjoy talking and playing with children?</li>\r\n<li>Do they talk with each child at the child&rsquo;s eye level?</li>\r\n<li>Are there plenty of toys and learning materials within the child&rsquo;s reach?</li>\r\n<li>Count ratio of adult supervision to children</li>\r\n</ul>\r\n<p><strong>Listen</strong></p>\r\n<ul>\r\n<ul>\r\n<li>Do the children sound happy and involved?</li>\r\nDo the teacher&rsquo;s voices seem cheerful and patient?</ul>\r\n</ul>\r\n<ul>\r\n<ul>A place that&rsquo;s too quiet may mean not enough activity. A place that&rsquo;s too noisy may mean there is a lack of control.</ul>\r\n</ul>\r\n<p class=\"_mce_tagged_br\"><strong>Count</strong></p>\r\n<ul>\r\n<li>Count the number of children in the group, then count the number of staff members caring for them. Obviously, the fewer the number of children to each adult, the more attention your child will receive. A small number of children per adult is most important for babies and younger children.</li>\r\n</ul>',0,35,'','','',1),(105,'Child Care Checklist',1,'txt','<p><span style=\"text-decoration: underline;\"><strong>Basics</strong></span></p>\r\n<ul>\r\n<li style=\"list-style-type: none;\">\r\n<ul>\r\n<li>License is displayed.</li>\r\n<li>Required staffing ratios are met.</li>\r\n<li>Written policies are available (including discipline policy).</li>\r\n<li>Group size is small enough to allow individual attention.</li>\r\n<li>The hours meet my needs.\r\n<p>&nbsp;</p>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><strong><span style=\"text-decoration: underline;\">Physical Facility</span></strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li style=\"list-style-type: none;\">\r\n<ul>\r\n<li style=\"text-decoration: underline;\">The room is bright, cheerful, and clean.</li>\r\n<li>Enough space is provided for activities.</li>\r\n<li>Children get things themselves.</li>\r\n<li>There are enough toys, paints, books, etc. for all children.</li>\r\n<li>Equipment (chairs, tables, sinks, toilets) is all child size and in good condition.\r\n<p>&nbsp;</p>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><strong>Staff</strong></span></p>\r\n<ul>\r\n<li style=\"list-style-type: none;\">\r\n<ul>\r\n<li>Caregivers have worked there for a year or more.</li>\r\n<li>Caregivers appear to enjoy what they do.</li>\r\n<li>Positive discipline techniques are used.</li>\r\n<li>Children are treated as individuals.</li>\r\n<li>Caregivers comfort the children when needed.</li>\r\n</ul>\r\n</li>\r\n</ul>',1,35,'','','',1),(106,'Child Safety Seat Tips and Recommendations',1,'txt','<p><strong>Fact:</strong> Motor vehicle crashes are the leading cause of death and injury for American children.<br><strong>Fact:</strong> All 50 states and the District of Columbia have passed mandatory child safety seat usage laws.</p>',0,36,'','','',1),(107,'Child Safety Seat Tips:',1,'txt','<ul>\r\n<li>The back seat is generally the safest place for a child in the event of a crash.</li>\r\n<li>Infants should ride in rear facing seat with restraints, until age 1 or 20 pounds. Read your safety seat manual for instructions regarding weight and height limits.</li>\r\n<li>Children over age 1 and 20 pounds may ride facing forward.</li>\r\n<li>The harness should be adjusted so you can slip one finger underneath the straps at your child\'s chest. The clip goes at armpit level.</li>\r\n<li>Keep your child in a safety seat with a full harness as long as possible, until they weigh at least 40 pounds.</li>\r\n<li>A belt-positioning booster seat is recommended for children between 40 to 80 pounds. It is used with the adult lap and shoulder belt.</li>\r\n</ul>',1,36,'','','',1),(108,'Parents are also reminded to:',1,'txt','<ul>\r\n<li>Avoid placing a child under age 12 in the front seat of a vehicle equipped with an air bag.</li>\r\n<li>Avoid using second-hand child safety restraints or restraints that have been involved in a crash.</li>\r\n<li>Always read carefully both the vehicle owner\'s manual and the seat manufacturer\'s instructions</li>\r\n</ul>\r\n<p>Your local Fire or Police Department has a Child Seat Safety Technician that offers free car seat installations or checks.</p>',2,36,'','','',1),(109,'Ways to Keep your Job & Get the Raise you Deserve!',0,'txt','<ol>\r\n<li>Increase your Knowledge &ndash; Look for ways to increase your skills, ask for cross training. The more you know the more your job will depend on your skills.</li>\r\n<li>Maintain a Positive Attitude &ndash; Enjoy being at work, avoid complaining and gossiping, smile and say hello to everyone. The more people like you, the more people will value you as a worker.</li>\r\n<li>Be a Good Listener &ndash; Show your co-workers you care about what they have to say. Listen to and follow directions. The more you understand, the better you can exceed your job&rsquo;s expectations.</li>\r\n<li>Show Initiative &ndash; Go the extra mile; learn to say &ldquo;How can I help&rdquo; instead of saying, &ldquo;that is not my job.&rdquo; Always look to exceed the expectation of your employer.</li>\r\n<li>Demonstrate Dependability and Reliability &ndash; Arrive to work 10 minutes early, use sick days for emergencies, complete tasks before the deadline, and keep your word. This way you will always be a &ldquo;go to person.&rdquo;</li>\r\n<li>Focus on Extraordinary Customer Service &ndash; Understand that the customer should always feel happy. Try to resolve the customer&rsquo;s problems. Learn how to satisfy your customer, and do not let difficult customers prevent you from providing quality services.</li>\r\n<li>Demonstrate Good Problem-Solving Skills &ndash; Share your ideas of how to make it a better work place. When you present a problem offer a solution. Think about how to make the best decision based on the policies and procedures.</li>\r\n<li>Be a Team Player &ndash; Understand that you will work with many different personalities. Avoid conflicts. It is ok to say you are sorry. Be willing to help your co-workers when needed.</li>\r\n<li>Understand your Role &ndash; Know what is expected of you and exceed those expectations. Read your job description. Ask what your boss expects from you. Review evaluations tools.</li>\r\n<li>Follow the Employer&rsquo;s Policies and procedures &ndash; Understand how to perform your job based on the company&rsquo;s policies. Complete tasks based on the set procedures. Ask clarifying questions when you do not understand a procedure.</li>\r\n</ol>',0,37,'','','',1),(110,'Finding Career Direction',1,'txt','<p>How long has it been since you asked yourself what you want to be when you grow up?</p>\r\n<p>If you haven\'t considered the idea since high school, then you may have settled into a job that is not fulfilling your professional aspirations, or your purpose.</p>\r\n<p>Each of us has particular talents that, when expressed or exercised, make the world a better place. Most likely you enjoy doing these things, and you find that people respond well to you when you do them. Perhaps&nbsp; they\'re things you gravitate towards during out-of-office-hours activities, and talents people respect you for.</p>',0,38,'','','',1),(111,'Your Career Direction Journey',1,'txt','<ul>\r\n<li>The process of uncovering what you are meant to do, that is finding career direction, is a journey. It starts with discovering the essential \"you\": the person who truly resides behind the facades, defenses, and stresses of everyday life.</li>\r\n<li>Once unmasked, your journey continues with specific career exploration and identification of a career that allows you to make good use of your talents. And it moves on with a focused job or career move, in which you identify the jobs you want and put yourself in the best possible position to get them. In fact, this journey never really ends because work itself is all about change, growth, development, and reinvention.</li>\r\n<li>By taking a talent-based approach to your career search right from the start, you keep yourself heading toward the right career even when the actual direction shifts over time.</li>\r\n</ul>',1,38,'','','',1),(112,'This approach consists of sequentially answering three questions:',1,'txt','<ol>\r\n<li>Who Am I?<ol>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n</ol></li>\r\n<li>What Do I Want to Do?<ol>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n</ol></li>\r\n<li>How Do I Get Hired?<ol>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n</ol></li>\r\n</ol>',0,39,'','','',1),(113,'Who Am I?',1,'txt','<ul>\r\n<li>The first question to answer is \"Who am I?\"</li>\r\n<li>When have you been most committed, passionate and enthusiastic?</li>\r\n<li>What do you consider to be your greatest accomplishment?</li>\r\n<li>For what would you take a very strong stand?</li>\r\n<li>What about the world puzzles or disturbs you that you could make an impact on?</li>\r\n<li>What jobs do you like to do at work when you have a choice?</li>\r\n<li>What activities are you drawn towards out of work?</li>\r\n<li>If money were no concern, what would you be doing?</li>\r\n</ul>\r\n<p>Brainstorm each of these questions, and then use your answers to identify the top 3 talents<br>that you most use when you\'re successful. Rank these in order.</p>',1,39,'','','',1),(114,'My Top 3 Talents',1,'txt','<ol>\r\n<li>_____________________________</li>\r\n<li>_____________________________</li>\r\n<li>_____________________________</li>\r\n</ol>',2,39,'','','',1),(115,'What Do I Want to Do?',1,'txt','<p>Now that you know who you are, the next stage is to think about what you want to do. Do any of the<br>listed industries interest you?</p>',0,40,'','','',1),(116,'Key Points',1,'txt','<ul>\r\n<li>Finding career direction is a process. The more effort you put into the planning stages the better your&nbsp; results. Uncovering your true self and your purpose is heavy, emotional work and you may have to go</li>\r\n<li>through this process a few times in the span of your working life. The effort however, is certainly worth it when you end up with a clear sense of the direction your career should be taking.</li>\r\n<li>The more contingency plans you have, the more likely you will be able to survive the inevitable setbacks. You will also have much more confidence in yourself despite the bumps in the road.&nbsp;</li>\r\n<li>Recognize that the more opportunities you have, the better the job that you\\\'ll be able to choose. Concentrate on creating as many opportunities as possible!</li>\r\n<li>Now you are free to pursue your dream career with confidence. There are certainly no guarantees but with the right amount of planning and a sufficient dose of reality, the career that you are meant for will materialize.</li>\r\n</ul>',1,40,'','','',1),(117,'Post-Secondary Education',1,'txt','<ul>\r\n<li>Post-secondary education refers to all education that follows high school, and so it is often optional. Undergraduate, postgraduate and vocational schools make up the various types of postsecondary education.</li>\r\n</ul>',0,41,'','','',1),(118,'Undergraduate Schools',1,'txt','<ul>\r\n<li>Undergraduate schools are often just called college, and are the most common schools for a student graduating high school to attend. These typically take two to four years to complete. In the U.S., an undergraduate degree will earn you an Associates (A.S) or (A.A) or Bachelor of Science (B.S.) or a Bachelor of Arts (B.A.) degree, depending on which course of study you choose to pursue.</li>\r\n</ul>',1,41,'','','',1),(119,'Postgraduate Schools',1,'txt','<ul>\r\n<li>A postgraduate degree is often earned at a university, and it can sometimes be earned at the same college where you earned your undergraduate Bachelor\'s degree. Attending a school for a postgraduate degree in the United States allows you to earn a master\'s degree in any number of subjects including master&nbsp; of fine arts (MFA), master of business administration (MBA), and master\'s of education (M.Ed.), to include some of the more common degrees.</li>\r\n</ul>',2,41,'','','',1),(120,'Vocational/Technical Schools',1,'txt','<ul>\r\n<li>Learning trades is done at vocational school. These are also called trade schools or career colleges. These schools are different from other types of schooling after high school in that they focus more on preparing you for a particular job. Examples of vocational type schools include dental school, veterinary school, and various schools that train for jobs involving computers. Some of these schools may require a previous undergraduate degree.</li>\r\n</ul>',3,41,'','','',1),(121,'Terminal Degrees',1,'txt','<ul>\r\n<li>Some degrees are referred to as \"terminal\" because they are the furthest degree you can get in a particular field of post-secondary education. An example is the doctorate. Doctoral degrees allow you to put \'Dr.\' before your name, even if the degree is not in the medical field. Literature, psychology, and history are some examples of fields you can receive a doctorate in. Some fields more associated with practice than theory, such as creative writing or acting, offer a master of fine arts as a terminal degree.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Read more: Post-Secondary Education Definition | eHow.com<br>http://www.ehow.com/about_4793321_post_secondary-education-definition.html#ixzz1z7ADvZ00</p>',4,41,'','','',1),(122,'Essential Elements of Job Search',1,'txt','<ul>\r\n<li>Job Search Techniques &amp; Resources</li>\r\n<li>Cover Letter/ R&eacute;sum&eacute;</li>\r\n<li>The Job Interview</li>\r\n</ul>',0,42,'','','',1),(123,'Start by writing down the career you want.',1,'txt','<p>For each of these steps create a detailed implementation plan.</p>\r\n<p><br>What is your long-term vision for yourself in terms of your career?</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>Write down the steps you need to take or the things you need to accomplish, in order to get there.</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________<br>What qualifications should you get?</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>What experience should you build?</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>Which organization will give you the best start?</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>',1,42,'','','',1),(124,'Making Yourself the Best Candidate',1,'txt','<ul>\r\n<li>Research the organization.</li>\r\n<li>Research the job.</li>\r\n<li>Familiarize yourself with the job description.</li>\r\n<li>Match your skills &amp; experience to the position.</li>\r\n<li>Know yourself.</li>\r\n<li>Project a positive attitude.</li>\r\n<li>Keep in touch with your contacts periodically.</li>\r\n<li>Write thank you notes and follow up after interview.</li>\r\n</ul>',0,43,'','','',1),(125,'Cover letter',1,'txt','<p>Cover Letter - a letter sent with your resume when applying for jobs. It provides additional information on your skills and experience and highlights qualifications on your resume.</p>',1,43,'','','',1),(126,'RÃ©sumÃ© Tips:',1,'txt','<ul>\r\n<li>Keep it short.</li>\r\n<li>Use a quality printer.</li>\r\n<li>Omit negative details.</li>\r\n<li>Do not include personal information.</li>\r\n<li>Proofread!</li>\r\n<li>Offer to provide references.</li>\r\n</ul>',2,43,'','','',1),(127,'Types of RÃ©sumÃ©s',1,'txt','<p><strong>Chronological</strong> &ndash; Chronological listing of jobs with most recent mentioned first.<br><strong>Functional</strong> &ndash; Highlights skills, talents, achievements and experience as they relate to the type of employment you seek rather than emphasizing work history.<br><strong>Combination</strong> &ndash; Focuses on skills and abilities as well as work history.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">Your Name<br>Address â— City, State, Zip Code â— Phone Number â— Email Address</p>\r\n<p style=\"text-align: left;\"><br>Personal Profile (Enter academic achievements, career goals, etc.)<br>â—<br>â—<br>â—<br>Education<br>School Name &ndash; School City, State<br>Degree expected, degree expected date<br>â—<br>â—<br>Experience<br>Professional Experience<br>Company name, dates of employment<br>Job description, responsibilities and accomplishments<br>â—<br>â—<br>Internship<br>Company name, dates of employment<br>Job description, responsibilities and accomplishments<br>â—<br>â—<br>Volunteer Experience<br>Company name, dates of volunteer service<br>Service description, responsibilities and accomplishments<br>â—<br>â—<br>Activities (List sports, clubs, etc. as well as dates of involvement)<br>â—<br>â—<br>â—</p>',0,44,'','','',1),(128,'Preparing for the Interview',1,'txt','<ul>\r\n<li>Do some research about the company and the position you are applying for.</li>\r\n<li>PRACTICE, PRACTICE, PRACTICE. Anticipate questions you might be asked beforehand and practice interviewing.</li>\r\n<li>Make a good first impression &ndash; dress appropriately, firm handshake, positive attitude and be on time.</li>\r\n<li>Adopt the employer&rsquo;s perspective when answering questions.</li>\r\n<li>Be able to answer the questions: What can you offer us? Why should we hire you? What distinguishes you from others?</li>\r\n<li>Ask questions if you are unsure of what you&rsquo;re being asked.</li>\r\n<li>Discuss experiences that relate to the position you are seeking.</li>\r\n<li>Ask the employer questions that demonstrate genuine interest in the position or company.</li>\r\n<li>Follow up &ndash; Ask for a business card and write a thank you letter.</li>\r\n</ul>',0,45,'','','',1),(129,'Got that Entrepreneurial Spirit?',1,'txt','<p>It takes more than a good idea and a desire to be your own boss to launch a successful venture. Follow these tips to increase your odds of success.</p>\r\n<table border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>1. Do you know how to operate a<br>computer?</p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n</td>\r\n<td>\r\n<p>4. If not, do you know how to set up an<br>email account and/or use the internet?</p>\r\n<p>_____________________________________</p>\r\n<p>_____________________________________</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>2. Do you have access to a computer with<br>internet capability? If so, how?</p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n</td>\r\n<td>\r\n<p>5. Do you know how to use Word, Excel<br>and other software?</p>\r\n<p>_____________________________________</p>\r\n<p>_____________________________________</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>3. Do you have an email account? If so,<br>what is it? Do you use it?</p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n</td>\r\n<td>\r\n<p>6. Do you have a business idea? If no,<br>have you thought about franchising?</p>\r\n<p>_____________________________________</p>\r\n<p>_____________________________________</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Please describe your business idea (purpose and operation)</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>',0,46,'','','',1),(130,'Sample: Work flow for a construction company',1,'txt','<p>_______________________________________________________________________________________________________</p>',0,47,'','','',1),(131,'Draw your own flow chart.',1,'txt','<p>Use the space below to draw a flow chart of all the steps needed for your business to operate.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',1,47,'','','',1),(133,'You may be eligible for Unemployment Compensation',1,'txt','<p>Unemployment Compensation (also called unemployment insurance) provides temporary wage replacement benefits to qualified individuals who are out of work thru no fault of their own.</p>',0,48,'','','',1),(132,'Tips to help a small business survive',1,'txt','<ul>\r\n<li>Step 1: Understand accounting.</li>\r\n<li>Step 2: Reduce overhead.</li>\r\n<li>Step 3: Make it work.</li>\r\n<li>Step 4: Barter for services.</li>\r\n<li>Step 5: Get the word out.</li>\r\n<li>Step 6: Build a winning team.</li>\r\n</ul>',2,47,'','','',1),(134,'Do I qualify?',1,'txt','<p>In order to qualify for benefits, you must:</p>\r\n<ul>\r\n<li>Have lost your job through no fault of your own</li>\r\n<li>Be actively looking for a new job</li>\r\n<li>Be ready to take a new job when offered</li>\r\n<li>Meet wage requirements based on your previous jobs</li>\r\n</ul>',1,48,'','','',1),(135,'How do I apply?',1,'txt','<p>The best way to file a claim is:</p>\r\n<ul>\r\n<li>Online at www.floridajobs.org . Click on the &ldquo;File for unemployment&rdquo; button and follow the directions.</li>\r\n<li>If you don&rsquo;t have internet access, you can file over the phone. Please direct your call to 211 for further assistance</li>\r\n</ul>',2,48,'','','',1),(136,'What is the next step?',1,'txt','<ul>\r\n<li>If you file online, you will receive a confirmation number and instructions on what actions to take and how to claim your benefits.</li>\r\n<li>If you file by phone, you will be instructed on how to claim your benefits through the automated certification process online or via phone</li>\r\n</ul>',3,48,'','','',1),(137,'What to expect.',1,'txt','<ul>\r\n<li>It typically takes three to four weeks to get your first check</li>\r\n<li>After you file your claim, you will need to certify every two weeks either online or over the phone that you are looking for a new job</li>\r\n<li>Help is available to find a new job at your local One &ndash; Stop Career Center and through Florida&rsquo;s job &ndash; matching and workforce resource website, <a title=\"Employ Florida\" href=\"http://www.employflorida.com\" target=\"_blank\">www.employflorida.com</a></li>\r\n</ul>',4,48,'','','',1),(139,'Let\'s eat for the health of it!',0,'txt','<p><strong>Let\'s eat for the health of it! Build a healthy plate</strong></p>\r\n<p><br><strong>Choose a change that you can make today, and move toward a healthier you.</strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><strong>Make healthy food choices</strong>\r\n<ul>\r\n<li>Make at least half your grains whole grains.</li>\r\n<li>Make half your plate fruits and vegetables.</li>\r\n<li>Vary your veggies.</li>\r\n<li>Focus on fruit.</li>\r\n<li>Get your calcium rich foods.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Keep food safe to eat</strong>.</li>\r\n<li><strong>Find your balance between food and physical activity.</strong></li>\r\n</ul>\r\n<p><em>Your food and physical activity choices each day affect your health &ndash; how you feel today, tomorrow, and in the future. These tips and ideas are a starting point. You will find a wealth of suggestions here that can help you get started toward a healthy diet</em></p>\r\n<p><strong><em>TOP 3 Grain Tips.</em></strong></p>\r\n<ol>\r\n<li style=\"text-align: left;\"><strong>&nbsp;Whole grains can be healthy snacks.</strong>\r\n<ul>\r\n<li style=\"text-align: left;\">Popcorn, a whole grain, can be a healthy snack. Make it with little or no added salt or butter.</li>\r\n</ul>\r\n</li>\r\n<li style=\"text-align: left;\"><strong>Bake up some whole-grain goodness.</strong>\r\n<ul>\r\n<li style=\"text-align: left;\">Experiment by substituting buckwheat, millet, or oat flour for up to half of the flour in pancake, waffle, muffin, or other flour-based recipes. They may need a bit more leavening in order to rise.</li>\r\n</ul>\r\n</li>\r\n<li style=\"text-align: left;\"><strong>Check the label for fiber.</strong>\r\n<ul>\r\n<li style=\"text-align: left;\">Use the Nutrition Facts label to check the fiber content of whole-grain foods. Good sources of fiber contain 10% to 19% of the Daily Value; excellent sources contain 20% or more.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: left;\">Grains:<br>Any food made from wheat, rice, oats, cornmeal, barley or another cereal grain is a grain product. Bread, pasta, oatmeal, breakfast cereals, tortillas, and grits are examples of grain products.</p>\r\n<p style=\"text-align: left;\">Grains are divided into 2 subgroups, whole grains and refined grains:</p>\r\n<p style=\"text-align: left;\">Create your own menu:</p>\r\n<p style=\"text-align: left;\">_______________________________________________________________________________</p>\r\n<p style=\"text-align: left;\">_______________________________________________________________________________</p>\r\n<p style=\"text-align: left;\">_______________________________________________________________________________</p>\r\n<p style=\"text-align: left;\">_______________________________________________________________________________</p>\r\n<p style=\"text-align: left;\">_______________________________________________________________________________</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">Your First Call for Help! | &nbsp;Tu Primera Llamada Para Ayuda! | Premye Apel Pou Ede! | Sua Primeira Chamada Para Ajuda!<br>Dial 2-1-1 Marque 2-1-1 Rele 2-1-1 Ligue 2-1-1</p>',0,50,'','','',1),(143,'Empty Calories',0,'txt','<p><strong>Empty Calories</strong><br>Many of the foods and beverages Americans eat and drink contain empty calories &ndash; calories from solid fats and/or added sugars. Solid fats and added sugars add calories to the food but few or no nutrients.</p>\r\n<p>&nbsp;</p>\r\n<table style=\"height: 227px; margin-left: auto; margin-right: auto; width: 738px;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><strong><span style=\"background-color: #ff6600; font-size: medium;\">Food with some empty calories</span></strong></td>\r\n<td><strong><span style=\"font-size: medium; background-color: #ff6600;\">Food with few or no empty calories</span></strong></td>\r\n</tr>\r\n<tr>\r\n<td>Sweetened applesauce (added sugars)</td>\r\n<td>Unsweetened applesauce</td>\r\n</tr>\r\n<tr>\r\n<td>Regular ground beef (75% lean) (solid fats)</td>\r\n<td>Extra lean ground beef (90% or more lean)</td>\r\n</tr>\r\n<tr>\r\n<td>Fried chicken (solid fats from frying and skin)</td>\r\n<td>Baked chicken breast without skin</td>\r\n</tr>\r\n<tr>\r\n<td>Sugar-sweetened cereals (added sugars)</td>\r\n<td>Unsweetened cereals</td>\r\n</tr>\r\n<tr>\r\n<td>Whole milk (solid fats)</td>\r\n<td>Fat-Free milk</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: small;\"><strong>Before you eat, think about what goes on your plate or in your cup or bowl. Foods like vegetables, fruits, whole grains, low-fat dairy products, and lean protein foods contain the nutrients you need without too many calories.</strong></span></li>\r\n<li><span style=\"font-size: small;\"><strong>Solid fats are fats that are solid at room temperature, like butter. Added sugars are sugars and syrups that are added when foods or beverages are processed or prepared.</strong></span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<table style=\"height: 173px; margin-left: auto; margin-right: auto; width: 736px;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: left;\"><strong><span style=\"font-size: large; background-color: #ff6600;\">Food I should avoid</span></strong></td>\r\n<td><span style=\"background-color: #ff6600; font-size: large;\"><strong>Food I would eat</strong></span></td>\r\n</tr>\r\n<tr>\r\n<td>Cakes, cookies pastries and donuts</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>Sodas, energy drinks, sports drinks, and fruit drinks</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>Pizza (solid fat)</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>Ice cream (both solid fat and added sugars)</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>Sausages, hotdogs, bacon and ribs (contain solid fat)</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>2013-04-08</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',0,53,'','','',1),(144,'Food Safety',0,'txt','<p><span style=\"font-size: x-large;\"><strong>Food Safety</strong></span></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Separate: Don\'t Cross Contaminate</strong></span></p>\r\n<p>Cross-contamination is how bacteria can be spread.</p>\r\n<ul>\r\n<li>When handling raw meat, poultry, seafood, and eggs, keep these foods and their juices away from ready-to-eat foods.</li>\r\n</ul>\r\n<ul>\r\n<li>Wash cutting boards, dishes, countertops, and utensils with hot soapy water.</li>\r\n<li>Separate raw meat, poultry, seafood, and eggs from other foods in your grocery shopping cart, grocery bags, and in your refrigerator.</li>\r\n<li>Use one cutting board for fresh produce and a separate one for raw meat, poultry, and seafood.</li>\r\n<li>Use a food thermometer, to make sure that the food is cooked to a safe internal temperature.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><strong>Cook: Cook to Proper Temperatures</strong></span><br>Food is safely cooked when it reaches a high enough internal temperature to kill the harmful bacteria<br>that cause foodborne illness.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Chill: Refrigerate Promptly!</strong></span><br>Refrigerate foods quickly because cold temperatures slow the growth of<br>harmful bacteria. Cold air must circulate to help keep food safe. Keeping a<br>constant refrigerator temperature of 40&deg;F or below is one of the most<br>effective ways to reduce the risk of foodborne illness. The freezer<br>temperature should be 0&deg;F or below.</p>\r\n<ul>\r\n<li>Refrigerate or freeze meat, poultry, eggs, and other perishables as soon as you get them home from the store.</li>\r\n<li><em><strong>Never</strong> </em>let raw meat, poultry, eggs, cooked food, or cut fresh fruits or vegetables sit at room temperature <em><strong>more than two hours</strong></em>.</li>\r\n<li>Food must be kept at a safe temperature during thawing. <em><strong>There are three safe ways to defrost food</strong></em>: in the refrigerator, in cold water, and in the microwave using the defrost setting.</li>\r\n<li>Always marinate food in the refrigerator.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>2013-04-08</p>',0,54,'','','',1),(145,'Eating Healthy on a Budget',0,'txt','<p><span style=\"font-size: medium;\"><strong>Eating Healthy on a Budget</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: x-small;\"><strong>Learn to cook</strong>. Youcan eat a lot cheaper by learning to cook and eating at home. Make it fun by cooking with friends</span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Cut back on prepackaged,preprepared food</strong>. Single-serve packages are more expensive.</span></li>\r\n<li><strong>Buy food and supplies in bulk</strong>. Check out your local grocery stores and bulk retailers for the best buys.</li>\r\n<li><strong>Use your freezer.</strong> Cook in large quantities and freeze your leftovers for another day. It&rsquo;s great to come home, grab a frozen leftover and pop it in the microwave. Voila! Hot food.</li>\r\n<li><strong>Buy generic.</strong></li>\r\n<li><strong>Drink water.</strong> Carry a refillable water bottle with you. Avoid buying sodas and snacks out of vending machines</li>\r\n<li><strong>Set a budget for snack items and then buy your snacks at the grocery store.</strong> Be sure to bring snacks with you when you leave your home.</li>\r\n<li><strong>Try different stress busters.</strong> Many people turn to food-especially gooey, fatty kinds &ndash; when stress levels go up. Develop other stress busters that can work for you with minimal calories and<br>cost, such as a brisk walk, a workout, or tea with a friend.</li>\r\n<li><strong>Plan ahead.</strong> Does your resolve to eat better weaken when your schedule is hectic? Take healthy snacks such as fruit and nuts with you on busy days.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: medium;\"><strong>How to save when buying groceries</strong></span></p>\r\n<p><br>1. <strong>Buy items on sale.</strong> Look for the Buy One Get One Free items.</p>\r\n<p><br>2. <strong>Use coupons</strong> (newspaper and internet).</p>\r\n<p><br>3. <strong>Make a list</strong> (try to stick to it).</p>\r\n<p><br>4. When buying fruits and vegetables consider visiting<br>your <strong>local farmer&rsquo;s market.</strong></p>\r\n<p><br>5. <strong>Do NOT shop when you are hungry.</strong></p>\r\n<p><br>6. <strong>Avoid purchasing non-grocery items at the grocery store</strong> (i.e. hair products,<br>cleaning products, etc.).</p>\r\n<p><br>7. <strong>Try store brands</strong> (sometimes they taste better than the name brand).</p>\r\n<p><br>8. <strong>Stay away from prepared meals.</strong> Often these meals are more expensive than preparing your own meals.</p>',0,55,'','','',1),(146,'Do you need help with food?',0,'txt','<p><span style=\"font-size: medium;\"><strong>Do you need help with food?</strong></span></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">You may want to consider looking for your local food pantry or congregate meal option. Both a food<br>pantry and a congregate meal may help you with your food needs. You may decide to use both or<br>choose to use only one.</span></span></p>\r\n<ul>\r\n<li><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Food Pantry: A food pantry helps meet the needs of hungry people in our community bysupplying groceries to those in need. Often a food pantry provides a free, three to five day<br>supply of emergency groceries for qualified individuals and families.</span></span><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><br><br></span></span></li>\r\n<li><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Congregate/Community: Meals include soup kitchens and senior dining rooms.<br>The congregate meal is a place where hot food is offered to the hungry for free or minimal cost.<br>Senior dining rooms also offer social time with activities.</span></span></li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline; font-size: small;\"><em><strong>Additional food options:</strong></em></span></p>\r\n<ul>\r\n<li><strong>Home delivered meals:</strong> If you are a homebound senior or person with disabilities, you may<br>be eligible for home delivered meals.</li>\r\n<li><strong>Emergency meals:</strong> One time service for seniors just coming home from the hospital or<br>those who suddenly find themselves in need of immediate assistance.</li>\r\n<li><strong>Grocery shopping:</strong> Available to seniors who are able to pay for their own groceries but are<br>unable to shop for themselves.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Florida WIC is the special supplemental nutrition program for Women, Infants, and Children. The program provides a combination of supplemental nutritious foods, nutrition education, breastfeeding promotion and support, and referrals for health care, immunizations, and community services to eligible<br>participants.</p>\r\n<p><span style=\"text-decoration: underline; font-size: small;\"><em><strong>Who is eligible for WIC?</strong></em></span></p>\r\n<p><span style=\"font-size: x-small;\">Pregnant and breastfeeding women, women who have recently been pregnant, infants and children under the age of 5 years who have a low or moderate income, are at nutrition risk, and who live in Florida.<br>A person is considered income-eligible for WIC if the household income is less than<br>or equal to those listed in the WIC Income Guidelines or if the person is currently receiving Medicaid, Temporary Cash Assistance (TCA) or Food Assistance. However a person DOES NOT have to be on a public assistance program to qualify for WIC.</span></p>\r\n<p>&nbsp;</p>',0,56,'','','',1),(147,'WIC / FREE or REDUCED Meals at School',0,'txt','<p><span style=\"text-decoration: underline;\"><em><strong>Applying for WIC:</strong></em></span></p>\r\n<ul>\r\n<li>The local WIC office will give you a date and time for a WIC certification visit. At this visit, the<br>household income and the medical/nutrition status of each applicant will be reviewed. On<br>that day, you will find out if you and your children are eligible for WIC.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>What food does WIC provide?</strong></em></span></p>\r\n<ul>\r\n<li>WIC provides food rich in certain key nutrients. Women and children enrolled in the WIC<br>program receive food checks for a variety of foods such as milk, cheese, eggs, cereals,<br>peanut butter or dry beans, and 100% fruit and vegetable juices. Women who are<br>exclusively breastfeeding their babies receive additional cheese, juice and dry beans, as well<br>as carrots and canned tuna fish. Infants who are not breastfed receive the WIC contract<br>brand of infant formula for the first year of life. Beginning at 6 months of age, infants may<br>also receive infant cereal and fruit juice. Special formulas or nutritional supplements are also<br>available to participants with certain medical conditions.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">FREE or REDUCED Meals at School</p>\r\n<p style=\"text-align: left;\"><span style=\"text-decoration: underline;\"><em><strong>Who can get free meals?</strong></em></span></p>\r\n<ul>\r\n<li style=\"text-align: left;\">All children in households receiving benefits from Florida SNAP, Florida TANF or the FDPIR (Food Distribution Program on Indian Reservations), can get free meals regardless of your income. Also, children in households participating in WIC may be eligible for free or reduced price meals.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>Can homeless, migrant, runaway and foster children get free</strong></em></span><br><span style=\"text-decoration: underline;\"><em><strong>meals?</strong></em></span></p>\r\n<ul>\r\n<li>Yes, children who meet the definition of homeless, migrant, runaway or foster children under the legal responsibility of a foster care agency or court are eligible for free meals.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>My child&rsquo;s application was approved last year; do I need to fill out another one?</strong></em></span><br><br></p>\r\n<ul>\r\n<li>Yes. Your child&rsquo;s application is only good for that school year and for the first few days of this<br>school year. You must send in a new application unless the Food and Nutrition Office told<br>you that your child is eligible for the new school year.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>If I don&rsquo;t qualify now, may I apply later?</strong></em></span></p>\r\n<ul>\r\n<li>Yes, you may apply at any time during the school year. For example, children with a parent<br>or guardian who becomes unemployed may become eligible for free or reduced price meals<br>if the household income drops below the income limit.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>What if I disagree with the Food and Nutrition Office&rsquo;s decision about my application?</strong></em></span></p>\r\n<ul>\r\n<li>You should talk to an official at the Food and Nutrition Office.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',0,57,'','','',1),(148,'Food Assistance and SUNCAP:',0,'txt','<p><strong>Food Assistance and SUNCAP</strong></p>\r\n<p>The SUNCAP Program is a special Food Assistance Program for individuals who receive Supplemental<br>Security Income (SSI). You may be eligible to receive food assistance benefits through the SUNCAP<br>Program without any additional application, paperwork, or interviews. If you already receive food<br>assistance benefits in the regular Food Assistance Program, you may be automatically put in the<br>SUNCAP Program when you become SSI eligible. If your food assistance benefits go down because<br>of SUNCAP, you may choose to continue receiving your food assistance under the regular Food<br>Assistance Program.</p>\r\n<p style=\"text-align: center;\"><strong>The new name for the Food Stamp Program is now the Supplemental Nutrition Assistance Program (SNAP)</strong></p>\r\n<p style=\"text-align: left;\"><strong>How can you find out if you may be eligible?</strong></p>\r\n<ul>\r\n<li style=\"text-align: left;\">The Food Assistance Program helps people with low-income buy healthy food. A food<br>assistance household is normally a group of people who live together and buy food and cook<br>meals together. If your household passes the Food Assistance Program\'s eligibility rules, the<br>amount of food assistance benefits you get depends on the number of people in your<br>household and how much money is left after certain expenses are subtracted.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>Eligibility Requirements</strong></em></span></p>\r\n<p>Individuals must pass all eligibility rules to get food assistance benefits. Some of the eligibility rules<br>are:</p>\r\n<ul>\r\n<li><strong>Identity</strong> - Applicants must provide proof of their identity.</li>\r\n<li><strong>Work Rules</strong> - Healthy adults, 18 to 50 years of age, who do not have dependent children or<br>are not pregnant, can only get food assistance benefits for 3 months in a 3-year period, if<br>they are not working or participating in a work or work force program.</li>\r\n<li><strong>Income and Deductions</strong> &ndash; Most households must pass a gross income limit at 200% of the<br>Federal Poverty Level (FPL).</li>\r\n<li><strong>Residency</strong> - Individuals must live in the state of Florida.</li>\r\n<li><strong>Citizenship</strong> - Individuals must be a U.S. citizen or have a qualified noncitizen status</li>\r\n<li><strong>SSN</strong> - Individuals must provide a Social Security Number or proof they have applied for one</li>\r\n<li><strong>Child Support Cooperation</strong> - Certain individuals must cooperate with the state\'s child<br>support enforcement agency to prove a child\'s legal relationship to their parent and to get the<br>court to order child support payments</li>\r\n<li><strong>Assets</strong> - Most food assistance households may have assets such as vehicles, bank<br>accounts, or property and still get help. Households with a disqualified member must meet an<br>asset limit of $2,000 or $3,250 effective October 1, 2011(if the household contains an elderly<br>or disabled member).</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>Foods You Can Buy With Food Assistance Benefits</strong></em></span></p>\r\n<ul>\r\n<li>Households can use food assistance benefits to buy breads, cereals, fruits, vegetables,meats, fish, poultry, dairy, and plants and seeds to grow food for your household to eat.Households cannot use food assistance benefits to buy nonfood items such as pet foods,soaps, paper products, household supplies, grooming items, alcoholic beverages, tobacco,vitamins, medicines, food to eat in the store, or hot foods.</li>\r\n</ul>',0,58,'','','',1),(149,'5 Myths & Facts about Food Stamps for the Elderly',0,'txt','<p><span style=\"font-size: small;\"><strong>5 Myths &amp; Facts about Food Stamps for the Elderly</strong></span></p>\r\n<p><span style=\"font-size: small;\">1. <strong>MYTH: Food stamps are welfare.</strong></span><br><span style=\"font-size: small;\"><strong>FACT:</strong> The Food Stamp Program is a nutrition assistance program, now called SNAP (Supplemental Nutrition Assistance Program), to help low income people buy nutritious food.</span></p>\r\n<p><br><span style=\"font-size: small;\">2.<strong> MYTH: Elderly people only receive a few dollars a month in food stamps.</strong></span><br><span style=\"font-size: small;\"><strong>FACT</strong>: $16 is the smallest amount of food stamps you can get and the average for the elderly is much higher.</span></p>\r\n<p><br><span style=\"font-size: small;\">3. <strong>MYTH: Elderly people cannot own a home and if they do, it will be taken away.</strong></span><br><span style=\"font-size: small;\"><strong>FACT:</strong> Anyone can own or buy a home and still get food stamps. The Food Stamp Program does not require anyone to give up their home or any assets.</span></p>\r\n<p><br><span style=\"font-size: small;\">4. <strong>MYTH: Elderly people must go to the food stamp office to apply for assistance.</strong></span><br><span style=\"font-size: small;\"><strong>FACT:</strong> It is not necessary to go to an office. There are many local organizations that help people apply online. To find a partner near you, please call &ldquo;2-1-1&rdquo;.</span></p>\r\n<p><br><span style=\"font-size: small;\">5.<strong> MYTH: Elderly people do not get a credit for medical bills</strong>.</span><br><span style=\"font-size: small;\"><strong>FACT:</strong> Medical bills may be deducted unless an insurance company</span><br><span style=\"font-size: small;\">pays them.</span></p>\r\n<p><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: small;\"><strong>5 Myths and Facts about Food Stamps &amp;</strong></span><br><span style=\"font-size: small;\"><strong>Immigrants</strong></span></p>\r\n<p><span style=\"font-size: small;\"><strong>1. MYTH: You have to be a U.S. citizen to get food stamps.</strong><br><strong>FACT:</strong> Some legal immigrants can get food stamps. If you are a legal immigrant, you may qualify.</span></p>\r\n<p><span style=\"font-size: small;\"><br><strong>2. MYTH: If you don&rsquo;t have legal status, you can&rsquo;t get food stamps.</strong><br><strong>FACT:</strong> Undocumented people can&rsquo;t get food stamps but citizens and some legal immigrants, who live with them, can get food stamps, including children.</span></p>\r\n<p><span style=\"font-size: small;\"><br><strong>3. MYTH: Children of undocumented immigrants can&rsquo;t get food stamps.</strong><br><strong>FACT:</strong> Children of undocumented immigrants may get food stamps if they are citizens or legal permanent<br>residents.</span></p>\r\n<p><span style=\"font-size: small;\"><br><strong>4. MYTH: Undocumented people who apply for Food Stamps, or live with people who get Food</strong><br><strong>Stamps are reported to United States Citizenship &amp; Immigration Services (USCIS).</strong><br><strong>FACT:</strong> Food Stamp information is confidential but the food stamp office checks immigration documents received with USCIS. If you are not documented, you won&rsquo;t be asked for immigration documents. Other members of the household can still apply and may be eligible.</span></p>\r\n<p><span style=\"font-size: small;\"><br><strong>5. MYTH: You can&rsquo;t get food stamps even if you have a green card and work.</strong><br><strong>FACT:</strong> Many legal immigrants are eligible. Generally, if you have been in the U.S. legally for 5 years or are a child under 18, get a disability-related benefit, or have enough work history in the U.S, you may be able to get food</span></p>',0,59,'','','',1),(150,'Test Your Knowledge',0,'txt','<p>1. Hands should be washed with<br>water and soap for at least:<br>a. 5 Seconds<br>b. 20 Seconds<br><br>2. Food should not be left at room<br>temperature for more than:<br>a. 2 hours<br>b. 10 hours</p>\r\n<p>3 The only way to be sure foods are<br>cooked long enough to kill harmful<br>bacteria is to:<br>a. Use a food Thermometer<br>b. Use a timer</p>\r\n<p>4. Is it safe to put cooked food on a<br>plate that held raw meat, poultry<br>or seafood?<br>a. Yes<br>b. No</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',0,60,'','','',1),(151,'Sample Menu for a 2000 Calorie Food Patern',0,'txt','<p>\"&gt;</p>\r\n<p><img src=\"\\&quot;file:/C:/Users/Carlos/Desktop/Calorie%20Food%20Pattern.png\\&quot;\" alt=\"\\&quot;\\&quot;\"></p>',0,61,'Sample Menu for a 2000 Ca','Sample Menu','left',1),(152,'My Pyramid Worksheet',0,'txt','<p>My Pyramid Worksheet</p>',0,62,'','','',1),(154,'Rent Assistance Options',0,'txt','<p><br>Rent Assistance Options</p>\r\n<p><br>What options are there for me?</p>\r\n<p><br>Housing Choice Voucher: The housing choice voucher program is the federal government&rsquo;s major<br>program for assisting very low income families, the elderly and people with disabilities to afford decent,<br>safe and sanitary housing in the private market that is administered locally by Public Housing Agencies<br>(PHA&rsquo;s)</p>\r\n<p><br>How it works&hellip;</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Eligibility is determined by the PHA&rsquo;s; during the application process the PHA will collect information such as the family income, assets, and family composition.</li>\r\n<li>A family is issued a housing voucher and is responsible for finding a suitable housing unit; the unit may include present residence.</li>\r\n<li>The participant is free to choose any housing that meets the requirements of the program and is not limited to units located in subsidized housing projects, so long as the owner agrees to rent through the program.</li>\r\n<li>The housing subsidy is paid to the landlord directly by PHA on behalf of the participating family; the family is now responsible to pay the difference (if any) between the actual rent charge and the amount subsidized.</li>\r\n</ul>\r\n<p>Public Housing: Is another program geared towards assisting low income families, the elderly and<br>people with disabilities with decent and safe rental housing. Public housing comes in all sizes and types<br>from scattered single family houses to high-rise apartments.</p>\r\n<p><br>How is eligibility determined &hellip;</p>\r\n<ul>\r\n<li>Annual gross income</li>\r\n<li>Whether you qualify as elderly, a person with disabilities or as a low income family.</li>\r\n<li>U.S citizenship or eligible immigration status</li>\r\n</ul>\r\n<p>Subsidized housing is a form of housing which is made accessible through<br>government assistance to people who have difficulty finding and affording housing.<br>Many governments have subsidy programs in place for housing, viewing safe, clean<br>pleasant places to live as important for their citizens.<br>If the PHA determines that you are eligible, your name will be put on a waiting list, unless<br>the PHA is able to assist you immediately. The PHA will contact you once your name is<br>reached on the waiting list. If it is determined that you are ineligible the PHA must say why<br>and if you wish you can request an additional hearing. If you would like more information on<br>the above programs and how to apply, contact your local Public Housing Authority or visit<br>the HUD website www.hud.gov.</p>',0,64,'','','',1),(142,'Fruits and Dairy',0,'txt','<p><strong>Top 3 Fruit Tips</strong></p>\r\n<ol>\r\n<li><strong>Keep visible reminders.</strong>\r\n<ul>\r\n<li>Keep a bowl of whole fruit on the table, counter, or in the refrigerator.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Include fruit at breakfast.</strong>\r\n<ul>\r\n<li>At breakfast, top your cereal with bananas, peaches, or strawberries; add blueberries to pancakes; drink 100% orange or grapefruit juice. Or, try a fruit mixed with fat-free or low-fat yogurt.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Think about variety.</strong>\r\n<ul>\r\n<li>Buy fruits that are dried, frozen, and canned (in water or 100% juice) as well as fresh, so that you always have a supply on hand.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p><strong>Fruits:</strong><br>&nbsp; &nbsp; Any fruit or 100% fruit juice counts as part of the Fruit Group. Fruits may be fresh, canned, frozen, or dried, and may be whole, cut-up, or pureed.</p>\r\n<p><br><strong>Create your own menu:</strong></p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Top 3 Dairy Tips</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Boost potassium and vitamin D, and cut sodium.</strong>\r\n<ul>\r\n<li>Choose fat-free or low-fat milk or yogurt more often than cheese. Milk and yogurt have more potassium and less sodium than most cheeses. Also, almost all milk and many yogurts are fortified with vitamin D.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Choose sweet dairy foods with care.</strong>\r\n<ul>\r\n<li>Flavored milks, fruit yogurts, frozen yogurt, and puddings can contain a lot of added sugars. These added sugars are empty calories. You need the nutrients in dairy foods&mdash;not these empty calories.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Can&rsquo;t drink milk?</strong>\r\n<ul>\r\n<li>If you are lactose intolerant, try lactose-free milk, drink smaller amounts of milk at a time, or try soymilk (soy beverage). Check the Nutrition Facts label to be sure your soymilk has about 300 mg of calcium.Calcium in some leafy greens is well absorbed, but eating several cups each day to meet calcium needs may be unrealistic.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p><strong>Dairy:</strong><br>&nbsp; &nbsp; All fluid milk products and many foods made from milk are considered part of this food group. Most Dairy Group choices should be fat-free or low-fat. Foods made from milk that retain their calcium content are part of the group. Foods made from milk that have little to no calcium, such as cream cheese, cream, and butter, are not. Calcium-fortified soymilk (soy beverage) is also part of the Dairy Group.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Create your own menu:</strong></p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>2013-04-08</p>',0,52,'','','',1),(141,'Protein & Vegetable ',0,'txt','<p><strong>Top 3 Protein Tips</strong></p>\r\n<ol>\r\n<li><strong>Choose seafood twice a week</strong>\r\n<ul>\r\n<li>Eat seafood in place of meat or poultry twice a week. Select a variety of seafood&mdash;include some that are higher in oils and low in mercury, such as salmon, trout, and herring.</li>\r\n</ul>\r\n</li>\r\n</ol><ol>\r\n<li><strong>Make meat and poultry lean or low fat</strong>\r\n<ul>\r\n<li>Choose lean or low-fat cuts of meat like round or sirloin and ground beef that is at least 90% lean. Trim or drain fat from meat and remove poultry skin.</li>\r\n</ul>\r\n</li>\r\n</ol><ol>\r\n<li><strong>Make a healthy sandwich</strong>\r\n<ul>\r\n<li>Choose turkey, roast beef, canned tuna or salmon, or peanut butter for sandwiches. Many deli meats, such as regular bologna or salami, are high in fat and sodium&mdash;make them occasional treats only.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Protein:</strong><br>All foods made from meat, poultry, seafood, beans and peas, eggs, processed soy products, nuts, and seeds are considered part of the Protein Foods Group. Beans and peas are also part of the Vegetable Group.</p>\r\n<p>&nbsp;</p>\r\n<p>Create your own menu:</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Top 3 Vegetable Tips</p>\r\n<ol>\r\n<li><strong>Check the freezer aisle</strong>\r\n<ul>\r\n<li>Frozen vegetables are quick and easy to use and are just as nutritious as fresh veggies. Try adding frozen corn, peas, green beans, spinach, or sugar snap peas to some of your favorite dishes or eat as a side dish.</li>\r\n</ul>\r\n</li>\r\n<li><strong>While you&rsquo;re out</strong>\r\n<ul>\r\n<li>If dinner is away from home, no need to worry. When ordering, ask for an extra side of vegetables or side salad instead of the typical fried side dish.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Try something new</strong>\r\n<ul>\r\n<li>You never know what you may like. Choose a new vegetable&mdash;add it to your recipe or look up how to fix it.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Vegetables:</strong><br>Any vegetable or 100% vegetable juice counts as a member of the Vegetable Group. Vegetables may be raw or cooked, fresh, frozen, or dried/dehydrated.</p>\r\n<p>&nbsp;</p>\r\n<p>Create your own menu:</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>',1,50,'','','',0),(155,'Rent Accumulation Table',0,'txt','<p><br>Rent Accumulation Table<br><br></p>',0,65,'','','',1),(156,'Buying a Home',0,'txt','<p>Most mortgage lenders require home buyers spend less than 30% of their Annual Adjusted<br>Income on home mortgage payments (Family Contribution). Use this sheet to determine what<br>your Family Contribution should be to meet the lenders&rsquo; guidelines.</p>\r\n<p><br>Computing Annual Income (How the 30% is determined)<br>Annual Income is determined by calculating:</p>\r\n<p><br>Anticipated total (or gross income) minus allowable exclusions.</p>\r\n<p><br>Part One: Calculating Annual Income<br>1. Multiply hourly wages by the number of hours worked/year<br>(2080 hrs.&rsquo; for full-time employment with a 40- hour work week and no overtime)<br>2. Multiply weekly wages by 52<br>3. Multiply bi-weekly wages by 26<br>4. Multiply semi-monthly wages by 24<br>5. Multiply monthly wages by 12</p>',0,66,'','','',1),(157,'Financial Assistance for Household Expenses',0,'txt','<p>There are several programs that help low income persons to meet economic emergencies. They are<br>designed to address personal or family budget needs that cannot be met due to sudden loss of income<br>or unexpected expenses. The assistance is short-term and may not be subject to a limited number of<br>incidents. There are many types of emergency financial assistance.<br>Emergency Food and Shelter Program (EFSP) EFSP is a federally funded program administered through local community agencies. In Broward County several agencies provide a<br>range of services under this program:</p>\r\n<ul>\r\n<li>Food baskets or food vouchers/gift cards</li>\r\n<li>Meals at mass feeding sites</li>\r\n<li>Lodging at mass shelter sites</li>\r\n<li>Emergency lodging at hotels/motels</li>\r\n<li>Rent/mortgage payment assistance (1 month) to prevent eviction</li>\r\n<li>First month&rsquo;s rent to prevent homelessness</li>\r\n<li>Utility bill assistance for one month&rsquo;s usage</li>\r\n</ul>\r\n<p>Eligibility for these services may vary between agencies, but generally involve a case-by-case<br>evaluation of a family&rsquo;s income/expense budget. Neither proof of citizenship nor qualified alien status is<br>required. Rent/mortgage/utility assistance may not be received under this program more often than<br>once in 12 months.</p>\r\n<p>Broward County Emergency Assistance:<br>Assistance may be obtained for rental payments, mortgage payments, and city utility bills of families who face one time economic emergencies (sudden loss of income or unexpected expenses).Eligibility is based on a review of a family&rsquo;s income/expenses and the circumstances that lead to the crisis. Payments are generally limited to 80% of the rental/mortgage payment or past due utility bill. This type of assistance may be used only once in a 24 month period and only three times during one&rsquo;s lifetime</p>\r\n<p>Low Income Home Energy Assistance Program (LIHEAP):<br>LIHEAP will help low income residents pay FPL electricity bills. Eligibility is based on family income at or below 150% of the federal poverty level, and regular LIHEAP assistance may be obtained once or twice per year (depending on funding levels). Additional FPL assistance may also be obtained for crisis situations under both LIHEAP and FPL&rsquo;s Care to Share program. Care to share may help some families who are not eligible under LIHEAP</p>',0,67,'','','',1),(158,'Beware of Foreclosure Rescue Scams!',0,'txt','<p>Real Help is Free!</p>\r\n<p><br>Foreclosure rescue and mortgage modification scams are growing problem that cost you thousands of dollars &ndash; or even your home. Scammers make promises that they can&rsquo;t keep such as guaranteeing to &ldquo; save &ldquo; your home or lower your mortgage , usually for a fee , often pretending that they have direct contact with your mortgage servicer- which they do not.</p>\r\n<p><br>AVOID anyone who:<br>1. Asks for FEE IN ADVANCE<br>2. Guarantees that they will stop foreclosure or modify a loan<br>3. Tells you to STOP PAYING your mortgage company and pay them instead<br>4. Pressures you to sign papers immediately.What to Do If You Have Been the Victim of a Scam<br>If you believe you have been the victim of a scam, you should file a complaint with the Federal<br>Trade Commission (FTC).</p>\r\n<p>Resources to Help You Avoid Scams:</p>\r\n<ul>\r\n<li>Federal Trade Commission- Watch the Foreclosure Resources Scams Video on the FTC&rsquo;s YouTube Channel.</li>\r\n<li>Office of the Comptroller of the Currency &ndash; The U.S Department of the Treasury&rsquo; Office of the Comptroller of the Currency provides tips and materials to help homeowners avoid mortgage modification and foreclosure rescue scams.</li>\r\n<li>Loan Modification Scam Prevention Network &ndash; The loan modification Prevention network is a national coalition of governmental and private organizations created to provide resources to educate home owners about the danger of loan modification scams and support federal, state and local efforts to combat these scams. If you believe you have been the victim of a scam, you can report the scam the campaign&rsquo;s online complaint form.</li>\r\n</ul>',0,68,'','','',1),(160,'Home Ownership Assistance',0,'txt','<p>The federal government allocates funds to large local cities to conduct housing and community related activities, repair streets, further fair housing etc. Among these eligible activities is providing financial assistance to homebuyers and homeowners for home purchase or rehabilitation. Navigating through the grant process can be difficult, particularly if you want to use it to purchase your first home. But this shouldn&rsquo;t discourage you from looking into what is available out there to help you become a home owner. Here are some tips and questions that can be incredibly helpful to navigate through the process.</p>\r\n<p><br>Pull the list of Community Development Block Grant Entitlement Cities from the www.hud.gov website<br>If you are interested, call the city that you are interested in and ask some of the following questions&hellip;<br>a) Do you offer funds to buyers for homeownerships?<br>b) What type of funding is available?<br>c) What are the eligibility requirements?<br>d) What is your process to access funds?<br>e) What is your process to access the funds?<br>f) Do I have to pay these funds back and if so, under what circumstances?<br>g) How will this affect the purchase of my home?</p>\r\n<p>After this the burden will fall on you. Each city has different requirements and criteria. Don&rsquo;t let the great deal of paperwork and eligibility verification required frustrate you!</p>\r\n<p>The process is the same if you are a homeowner seeking rehabilitation assistance for your current home.</p>',0,70,'','','',1),(161,'Financial Plan:',0,'txt','<p>Have you ever wanted to buy something big,<br>like your own computer or a car? Or dreamed<br>about becoming a multi-millionaire and retiring<br>at 40?</p>\r\n<p><br>It is possible for you to do all of these things if you get<br>savvy about managing your money.</p>\r\n<p><br>In this section, you will begin your journey toward<br>savvy money management by learning about the financial planning process. People who &ldquo;have it all&rdquo;<br>didn&rsquo;t get there by accident. They made a financial plan and allowed it. You will use what you learn<br>in this section to create your own personal financial plan.</p>\r\n<p><br>Although we might not realize it, we are always managing money to get something we want, but in<br>order to achieve this goal we have to follow some sort of roadmap or a blueprint for our journey. A<br>monthly Budget Guide is one of the most important tools to good money management, because it&rsquo;s<br>a simple aid, created to give us an overview of our current economic situation and a glimpse of our<br>foreseeable future.</p>\r\n<p><br>The Basics of Financial Planning<br>&loz; Make money work for you so you can lead the kind of life you want.<br>&loz; Don&rsquo;t let money control you.<br>&loz; Always remember that it is just a means to an end, not the end itself</p>\r\n<p>Step 1: Set Financial Goals<br>Step 2: Analyze Your Spending: Where Does Your Money Go?<br>Step 3: Create a Budget: Build Your Financial Roadmap<br>Step 4: Stay on Track: Monitor and Modify the Plan to Fit<br>Step 5:Your Goals<br>Step 6:Work with Your Budget: Be a Responsible Spender</p>\r\n<p>&nbsp;</p>',0,71,'','','',1),(162,'Needs vs. Wants',0,'txt','<p>Needs vs. Wants</p>',0,72,'','','',1),(163,'Step 1: Setting Goals',0,'txt','<p>Step 1: Setting Goals</p>',1,73,'','','',1),(164,'Step 2: Analyze Your Spending',0,'txt','<p>Step 2: Analyze Your Spending</p>',0,74,'','','',1),(165,'Income & Expenses',0,'txt','<p>Income &amp; Expenses</p>',0,75,'','','',1),(166,'Guidelines for Sticking with Your Plan',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: medium;\"><strong>Guidelines for Sticking with Your Plan</strong></span></p>\r\n<ul>\r\n<li style=\"font-size: x-small;\"><span style=\"font-size: x-small;\"><span style=\"font-size: x-small;\"> Write your goals on an index card or find pictures of your goals and post them in a place<br>where you can see them every day.</span></span></li>\r\n<li style=\"font-size: x-small;\"><span style=\"font-size: x-small;\"><span style=\"font-size: x-small;\">Tell other people about your goals. Also ask someone to check in with you about your<br>progress &ndash; knowing someone is going to ask about it is good motivation!</span></span></li>\r\n<li style=\"font-size: x-small;\"><span style=\"font-size: x-small;\"><span style=\"font-size: x-small;\">When you&rsquo;re going to spend money, decide how much you&rsquo;ll need ahead of time and<br>take only that amount so that you&rsquo;re not tempted to spend more.</span></span></li>\r\n<li style=\"font-size: x-small;\"><span style=\"font-size: x-small;\"><span style=\"font-size: x-small;\">Review your plan regularly so you know when you&rsquo;re starting to stray and can make<br>adjustments quickly.</span></span></li>\r\n</ul>\r\n<p><span style=\"font-size: medium;\"><strong>Are You Saving?</strong></span></p>\r\n<p><span style=\"text-decoration: underline;\"><span style=\"font-size: small;\"><strong>Why Is Saving Money Important?</strong></span></span></p>\r\n<p><span style=\"font-size: x-small;\">Every day we are faced with an expense, a bill or an item we need to purchase. This makes saving extra money very difficult. At the same time, without saving we are not planning ahead for those emergencies that happen to everyone. No one wants to plan for losing their job, becoming disabled, the car breaking down, or some other financial crisis. Saving is critical to successfully facing these crises. With savings, we have an increased possibility of having the money available to resolve the problems we did not expect. </span></p>\r\n<p><span style=\"text-decoration: underline; font-size: small;\"><strong>How Can I Save Money?</strong></span></p>\r\n<p><span style=\"font-size: x-small;\">1. Skip going out to eat.<br>2. Turn off the lights when you are not in the room.<br>3. Have a piggy bank for the whole family to make<br>contributions.<br>4. Have an automatic deposit from your paycheck into<br>your savings account.<br>5. Find coupons and sales.<br>6. Stop using the vending machine.<br>7. Find cheap gas.<br>8. Choose the cheapest mode of transportation possible.<br>9. Teach your kids how to save.</span></p>\r\n<p><span style=\"text-decoration: underline; font-size: small;\"><strong>Build Emergency Funds</strong></span></p>\r\n<p><span style=\"font-size: x-small;\">Set aside savings for emergency purposes. An ideal savings is about 9 months of your monthly cost of living. This part of your financial plan is a good way of avoiding taking out loans.</span></p>',0,76,'','','',1),(167,'Why is Retirement Planning Important?',0,'txt','<p><span style=\"text-decoration: underline; font-size: medium;\"><strong>Why is Retirement Planning Important?</strong></span></p>\r\n<p><span style=\"font-size: x-small;\">It is never too early to plan for retirement. Planning for retirement will help you build a sense of security<br>after you make the transition from employment to retirement. Importantly, by planning for retirement<br>you will more likely stay independent instead of placing a big pressure on your family and loved<br>ones to take care of you at an old age.</span></p>\r\n<p><span style=\"font-size: x-small;\">&nbsp;</span></p>',0,77,'','','',1),(168,'How Do I Save for Retirement with a Small Salary?',0,'txt','<p><span style=\"text-decoration: underline; font-size: medium;\"><strong>How Do I Save for Retirement with a Small Salary?</strong></span></p>\r\n<ol>\r\n<li><span style=\"font-size: x-small;\"><strong>Set up a direct deposit.</strong> Have a portion of each paycheck automatically deposited into a401(k), IRA, savings, or investment account. Start with as little as 1 percent of your pay and as you<br>receive raises, direct a portion of each one into a retirement or investment account.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Take advantage of tax breaks</strong>. Saving in a retirement account has the added bonus ofreducing your current or future taxes. Traditional 401(k)s and IRAs give you a tax break in the year<br>you make the contribution.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Claim the saver\'s credit</strong>. There is a tax credit specifically for low-income workers who savefor retirement. If you contribute to a retirement account such as an IRA or 401(k) , you may be able<br>to claim the saver\'s credit.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Redirect your tax refund and tax break</strong>. If you don\'t need your tax refund for immediateexpenses or debts, consider saving a portion of it for retirement.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Learn about Social Security</strong>. Social Security payments are the biggest source of retirementincome for low-wage workers. The age when you decide to start your benefit can make a big<br>difference in how much your monthly payments will be for the rest of your life. Think carefully about<br>whether you want to start that Social Security benefit right away when you hit 62, or whether it\'s<br>really more valuable to you to wait until age 70 if you can do so. Monthly payouts increase for each<br>year you delay claiming up until age 70.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Seek a job with good retirement benefits</strong>. Finding a job that offers a traditional pension, asignificant 401(k) match, or a profit-sharing plan can significantly improve your retirement security.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Don\'t spend your savings early</strong>. Once you begin to build a nest egg, try not to spend any ofit before retirement. Early withdrawals also mean that you won\'t have that money and the valuable<br>compound interest it could have generated in retirement</span></li>\r\n</ol>',1,77,'','','',1),(169,'The Cost of Financial Services',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: medium;\"><strong>The Cost of Financial Services</strong></span></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Finding financial services that meet your needs is not an easy task. It is especially difficult if you are</span><br><span style=\"font-size: x-small;\">experiencing financial hardship.</span></span></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Please know that all financial institutions are not alike. There are traditional<br>banks and credit unions, but there are also non-traditional lending institutions<br>such as payday loan stores, check cashing stores, pawn shops and corner<br>stores that offer similar services, but for a different price.</span></span></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><br>While the decision of selecting which type of financial institution may be hard,<br>there are many things to consider related to the</span></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><span style=\"text-decoration: underline;\">FEES for services</span>,</span></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><span style=\"text-decoration: underline;\">PENALTIES for services</span> and</span></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><span style=\"text-decoration: underline;\">the EXPEDIENCE of the service</span>.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Sometimes what may be convenient is actually more expensive.</span></span></p>\r\n<p style=\"text-align: center;\"><strong><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><em>CAUTION!</em> Think about what convenience is worth to you</span></span></strong></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">For example, it&rsquo;s Friday, and you just received your pay. Your check was drawn by a local bank that<br>does not charge a fee for check cashing services. The bank is relatively close, but the corner store<br>is right across the street. They charge $5.</span></span></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Would you go to the corner store? Is your convenience worth $5?</span></span></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Sometimes it is not a matter of choice. Perhaps, you have made some poor decisions in the past that left you with limited choices.</span></span></p>\r\n<p><em><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><strong>Guess what? You have a second chance!</strong> </span></span></em></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Many lending institutions have second chance programs forbanking as long as you demonstrate a commitment to paying back what you owe. The first step is your willingness to correct the old mistake.<br></span></span></p>',0,78,'','','',1),(170,'10 steps to shopping for a financial institution',0,'txt','<p>There are a number of ways to save your money, invest your money and to keep your<br>money safe.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: small;\"><strong>10 steps to shopping for a financial institution</strong></span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><span style=\"font-size: x-small;\">1. Educate yourself and do the proper research to find the options that will benefit you</span><br><span style=\"font-size: x-small;\">personally and financially. You!</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">2. Figure out what you want out of the bank you choose,</span><br><span style=\"font-size: x-small;\">simple savings or multiple services.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">3. Check out the different interest rates paid while your money</span><br><span style=\"font-size: x-small;\">is in the bank.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">4. Decide if you want a bank close to home or work, or if using</span><br><span style=\"font-size: x-small;\">ATM, multiple locations.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">5. Investigate the fees the bank charges for checking, overdraft</span><br><span style=\"font-size: x-small;\">penalty, or if a minimum balance is required.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">6. Visit the banks you are interested in doing business with. Is</span><br><span style=\"font-size: x-small;\">the staff professional and courteous? Do you feel</span><br><span style=\"font-size: x-small;\">comfortable banking there?</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">7. Ask your friends and family where they bank and if they are satisfied or recommend their</span><br><span style=\"font-size: x-small;\">bank.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">8. Remember, this is a big decision and it&rsquo;s your decision to make. You don&rsquo;t have to give</span><br><span style=\"font-size: x-small;\">your money to a financial institution that has poor customer service or limited hours of</span><br><span style=\"font-size: x-small;\">operation.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">9. If using ATM cards, check out the locations and make sure they are convenient. If you</span><br><span style=\"font-size: x-small;\">use an ATM that does not belong to your bank you will most likely pay a fee. Tip &ndash; If you</span><br><span style=\"font-size: x-small;\">need cash and are out shopping and don&rsquo;t have access to an ATM that is associated</span><br><span style=\"font-size: x-small;\">with your bank, ask for cash back when you make your purchases with your debit card.</span><br><span style=\"font-size: x-small;\">There is no charge.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">10.You may want to research credit unions, a cooperative financial institution, owned and</span><br><span style=\"font-size: x-small;\">controlled by the people who use its services. The difference between a bank and a</span><br><span style=\"font-size: x-small;\">credit union is that credit unions are non- profit institutions and are not in business to</span><br><span style=\"font-size: x-small;\">make a profit like regular banks. You should make certain that the credit union you are</span><br><span style=\"font-size: x-small;\">researching is convenient for your banking</span></span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>',0,79,'','','',1),(171,'Monthly Budget Guide',0,'txt','<p>Monthly Budget Guide</p>',0,80,'','','',1),(172,'Staying on Track',0,'txt','<p><span style=\"font-size: medium;\"><strong>Step 5: Staying on Track</strong></span></p>\r\n<p><span style=\"font-size: x-small;\">Once you start working with your budget, you should check to make sure that you&rsquo;re staying on track. Review your plan and your progress at periods &ndash; every two weeks or every month. The more often you review your budget, the sooner you&rsquo;ll catch yourself if you start straying off course.</span></p>\r\n<p><strong><span style=\"font-size: x-small;\">1. How Am I Doing?</span></strong></p>\r\n<p><span style=\"font-size: x-small;\"><strong>2. Review your budget whenever you have significant changes in your life.</strong><br>&loz; Marriage/divorce<br>&loz; Goals change<br>&loz; Income change<br>&loz; Unexpected expenses<br>&loz; Unexpected income</span></p>\r\n<p><span style=\"font-size: x-small;\"><strong>3. Update your budget with amounts that fit your new situation.</strong></span></p>\r\n<p><strong><span style=\"font-size: x-small;\"><br>4. Keep track of how the current budget works for you.</span></strong></p>\r\n<p><strong><span style=\"font-size: x-small;\"><br>5. Remember: your budget and financial plan have to be responsive to your current<br>situation but keep in mind your long term goals.</span></strong></p>',0,81,'','','',1),(173,'Protein & Vegetables',0,'txt','<p><strong>Top 3 Protein Tips</strong></p>\r\n<ol>\r\n<li><strong>Choose seafood twice a week</strong>\r\n<ul>\r\n<li>Eat seafood in place of meat or poultry twice a week. Select a variety of seafood&mdash;include some that are higher in oils and low in mercury, such as salmon, trout, and herring.</li>\r\n</ul>\r\n</li>\r\n</ol><ol>\r\n<li><strong>Make meat and poultry lean or low fat</strong>\r\n<ul>\r\n<li>Choose lean or low-fat cuts of meat like round or sirloin and ground beef that is at least 90% lean. Trim or drain fat from meat and remove poultry skin.</li>\r\n</ul>\r\n</li>\r\n</ol><ol>\r\n<li><strong>Make a healthy sandwich</strong>\r\n<ul>\r\n<li>Choose turkey, roast beef, canned tuna or salmon, or peanut butter for sandwiches. Many deli meats, such as regular bologna or salami, are high in fat and sodium&mdash;make them occasional treats only.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Protein:</strong><br>All foods made from meat, poultry, seafood, beans and peas, eggs, processed soy products, nuts, and seeds are considered part of the Protein Foods Group. Beans and peas are also part of the Vegetable Group.</p>\r\n<p>&nbsp;</p>\r\n<p>Create your own menu:</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Top 3 Vegetable Tips</p>\r\n<ol>\r\n<li><strong>Check the freezer aisle</strong>\r\n<ul>\r\n<li>Frozen vegetables are quick and easy to use and are just as nutritious as fresh veggies. Try adding frozen corn, peas, green beans, spinach, or sugar snap peas to some of your favorite dishes or eat as a side dish.</li>\r\n</ul>\r\n</li>\r\n<li><strong>While you&rsquo;re out</strong>\r\n<ul>\r\n<li>If dinner is away from home, no need to worry. When ordering, ask for an extra side of vegetables or side salad instead of the typical fried side dish.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Try something new</strong>\r\n<ul>\r\n<li>You never know what you may like. Choose a new vegetable&mdash;add it to your recipe or look up how to fix it.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Vegetables:</strong><br>Any vegetable or 100% vegetable juice counts as a member of the Vegetable Group. Vegetables may be raw or cooked, fresh, frozen, or dried/dehydrated.</p>\r\n<p>&nbsp;</p>\r\n<p>Create your own menu:</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>',1,0,'','','',1),(174,'Protein & Vegetables',0,'txt','<p>Top 3 Protein Tips</p>\r\n<p>Choose seafood twice a week<br>Eat seafood in place of meat or poultry twice a week. Select a variety of seafood&mdash;include some that are higher in oils and low in mercury, such as salmon, trout, and herring.<br>Make meat and poultry lean or low fat<br>Choose lean or low-fat cuts of meat like round or sirloin and ground beef that is at least 90% lean. Trim or drain fat from meat and remove poultry skin.<br>Make a healthy sandwich<br>Choose turkey, roast beef, canned tuna or salmon, or peanut butter for sandwiches. Many deli meats, such as regular bologna or salami, are high in fat and sodium&mdash;make them occasional treats only.</p>\r\n<p>Protein:<br>All foods made from meat, poultry, seafood, beans and peas, eggs, processed soy products, nuts, and seeds are considered part of the Protein Foods Group. Beans and peas are also part of the Vegetable Group.</p>\r\n<p>&nbsp;</p>\r\n<p>Create your own menu:</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Top 3 Vegetable Tips</p>\r\n<p>Check the freezer aisle<br>Frozen vegetables are quick and easy to use and are just as nutritious as fresh veggies. Try adding frozen corn, peas, green beans, spinach, or sugar snap peas to some of your favorite dishes or eat as a side dish.<br>While you&rsquo;re out<br>If dinner is away from home, no need to worry. When ordering, ask for an extra side of vegetables or side salad instead of the typical fried side dish.<br>Try something new<br>You never know what you may like. Choose a new vegetable&mdash;add it to your recipe or look up how to fix it.</p>\r\n<p>Vegetables:<br>Any vegetable or 100% vegetable juice counts as a member of the Vegetable Group. Vegetables may be raw or cooked, fresh, frozen, or dried/dehydrated.</p>\r\n<p>&nbsp;</p>\r\n<p>Create your own menu:</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>',0,82,'','','',1),(175,'What is Assisted Living?',0,'txt','<div class=\"WordSection1\">\r\n<p align=\"center\"><strong><span style=\"text-decoration: underline;\">What is Assisted Living?</span></strong></p>\r\n<p align=\"center\"><em>The general purpose of an assisted living community is to provide a supportive environment with choices and assistance to help seniors maintain independence and continue to enjoy quality of life. </em></p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong><span style=\"text-decoration: underline;\">Triggers to begin exploring assisted living</span></strong></p>\r\n<ul>\r\n<li><em>Need help bathing, dressing, and grooming</em></li>\r\n<li><em>Forgetting to take meds</em></li>\r\n<li><em>Requires more than 4 hours private duty assistance</em></li>\r\n<li><em>Weight loss or nutrition deficiency</em></li>\r\n<li><em>Physical declines, falling</em></li>\r\n<li><em>Mental changes</em></li>\r\n<li><em>Isolation, no longer socializing</em></li>\r\n</ul>\r\n<p align=\"center\"><strong>&nbsp;</strong></p>\r\n<p align=\"center\"><strong>Services and features found in an assisted living community</strong></p>\r\n</div>\r\n<p><em><br clear=\"all\"> </em></p>\r\n<div class=\"WordSection2\">\r\n<ul>\r\n<li><em>Private or shared accommodations- studios, 1 bedroom, 2 bedroom apartments</em></li>\r\n<li><em>3 meals per day </em></li>\r\n<li><em>Snacks and beverages</em></li>\r\n<li><em>Utilities </em></li>\r\n<li><em>Weekly housekeeping and laundry service</em></li>\r\n<li><em>Daily bed making</em></li>\r\n<li><em>Maintenance services</em></li>\r\n<li><em>Scheduled transportation service</em></li>\r\n<li><em>Escorted group outings</em></li>\r\n<li><em>Certified Nurse Assistant &nbsp;to assist with activities of daily living (ADL&rsquo;s) &ndash; showers, dressing, grooming, incontinence care, companion service, cueing and reminding</em></li>\r\n<li><em>Medication management</em></li>\r\n<li><em>Frequent checks for those at risk</em></li>\r\n<li><em>On site physical therapy and visiting physician</em></li>\r\n<li><em>Daily social lifestyle activities </em></li>\r\n<li><em>Exercise and wellness program</em></li>\r\n</ul>\r\n</div>\r\n<p><strong><span style=\"text-decoration: underline;\">Costs</span></strong></p>\r\n<ul>\r\n<li><em>Base rent (includes rent, utilities, meals, housekeeping, transportation, laundry service, activities, emergency call system) </em></li>\r\n<li><em>Level of Care (as low as basic wellness monitoring to as high as total care) </em></li>\r\n</ul>\r\n<p><strong><span style=\"text-decoration: underline;\">Financial Assistance</span></strong></p>\r\n<ul>\r\n<li><em>VA aid and attendance</em></li>\r\n<li><em>Medicaid Diversion</em></li>\r\n<li><em>Medicaid waiver</em></li>\r\n</ul>\r\n<p><strong><br clear=\"all\"> </strong></p>\r\n<div class=\"WordSection3\">\r\n<p><em>&nbsp;</em></p>\r\n<p>&nbsp;</p>\r\n<p><em>&nbsp;</em></p>\r\n</div>\r\n<p><strong><br clear=\"all\"> </strong></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',7,83,'','','',1),(176,'Where do I go?',0,'txt','<p class=\"Body\" align=\"center\"><strong>Where do I go? </strong></p>\r\n<p align=\"center\"><strong>The Emergency Room? &nbsp; Health Clinic? Urgent Care Center <br></strong></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\"><strong>Basic Health Tips to Save Your Dollars</strong></p>\r\n<ul>\r\n<li>Base your choice based on the severity of the illness, condition.</li>\r\n<li>Use the Emergency Room for serious conditions, especially if life threatening.&nbsp;</li>\r\n<li>Avoid the Emergency Room for the less serious conditions.</li>\r\n<li>Explore your local health clinics before visiting an Urgent Care Center.&nbsp;</li>\r\n<li>Take care of yourself and your children &ndash; follow the preventive health care habits.</li>\r\n<li>Call a Health Helpline and seek health advice.</li>\r\n</ul>\r\n<p class=\"Body\">&nbsp;</p>\r\n<p class=\"Body\"><strong>When you have a life-threatening situation, such as chest pain or a sudden severe pain, the emergency department of your nearest hospital is your only choice! </strong></p>\r\n<p class=\"Body\">&nbsp;</p>\r\n<p class=\"Body\">If you have any of the following:</p>\r\n<p class=\"Body\" align=\"center\"><strong>CALL 9-1-1 or go to your nearest emergency room!</strong></p>\r\n<p><strong>Emergency Rooms </strong>areequipped to handle even the most critical situations. Emergency Rooms and Trauma Centers are prepared to care for patients at high risk due to illness or injury. &nbsp;Urgent Care Centers are not.&nbsp; &nbsp;If you went to an urgent care clinic, they\'d just send you to the ER in an ambulance.</p>\r\n<p>&nbsp;</p>\r\n<p align=\"center\"><em>Emergency services are available around-the-clock, every day of the year.</em></p>\r\n<p class=\"Body\" align=\"center\"><strong><strong><br clear=\"all\"> </strong></strong></p>',3,84,'','','',1),(177,'Urgent Care Centers',0,'txt','<div class=\"WordSection1\">\r\n<p><strong><span style=\"text-decoration: underline;\">Urgent Care Centers</span></strong> are useful for minor burns or injuries, sprains or strains, coughs and colds, ear infections, fever, rash, mild asthma, animal bites, and minor broken bones. Call ahead and the clinic can advise you if they accommodate your condition otherwise they will direct you to the nearest emergency room. &nbsp;Often urgent care centers are not open on a continuous basis, unlike a hospital emergency department which would be open at all times.</p>\r\n<p class=\"Body\">&nbsp;</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Health Clinics</span></strong><strong> - </strong>local facilities that provide care at no cost or on a sliding scale based on your income. They offer medical care for patients who cannot afford health insurance or are underinsured. These services include adult services which provide patients with medical treatment as well as educational programs and services. In addition, OB/GYN and pediatrics clinics provide an array of quality healthcare services and will assist patients with future family planning needs.</p>\r\n<p><strong>When a Health Clinic or Urgent Care Center can better meet your needs:</strong></p>\r\n</div>\r\n<ul>\r\n<li>Minor burns or injuries</li>\r\n<li>Sprains and strains</li>\r\n<li>Coughs, colds, and sore throats</li>\r\n<li>Ear infections</li>\r\n<li>Allergic reactions (non life-threatening)</li>\r\n<li>Fever or flu-like symptoms</li>\r\n<li>Rash or other skin irritations</li>\r\n<li>Mild asthma</li>\r\n<li>Animal bites</li>\r\n<li>Broken Bones</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><em>And when in doubt, call ahead.</em> If the clinic in question can\'t accommodate your condition, they will advise you to go to the nearest emergency facility.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Health Care Helpline</span></strong><strong> &ndash; </strong>Often staffed by professional nurses who provide hands-on care and answering questions over the phone.&nbsp; People can call for free information about staying well, assessing symptoms or with questions about a particular illness or disease.</p>',0,85,'','','',1),(178,'Preventive Health Care',0,'txt','<p align=\"center\"><strong>Preventive Health Care</strong></p>\r\n<p align=\"center\">helps avoid trips to the Emergency Room and Health Clinics</p>\r\n<p align=\"center\"><strong><em>Keep the dollars in your pocket!</em></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>The most important part of preventive health care is maintaining good health habits</em></strong>.</p>\r\n<p>These include:</p>\r\n<ul>\r\n<li>Daily exercise</li>\r\n<li>Weight control</li>\r\n<li>Proper nutrition</li>\r\n<li>Avoidance of smoking and drug abuse</li>\r\n<li>Abstinence from, or moderation of, alcohol use</li>\r\n<li>Proper control of any diseases or disorders, such as high blood pressure, diabetes, or high levels of cholesterol in the blood</li>\r\n</ul>',1,85,'','','',1),(179,'Affordable Dental Services',0,'txt','<p><strong><em>Broward County Health Department Dental Office wants to be your &ldquo;Provider of Choice&rdquo; for dental services.</em></strong></p>\r\n<p><strong>Accepts many dental plans including:</strong></p>\r\n<ul>\r\n<li class=\"BodyA\">Medicaid * and Medikids</li>\r\n<li class=\"BodyA\">Plans accepted</li>\r\n<li class=\"BodyA\">Florida Healthy Kids</li>\r\n<li class=\"BodyA\">Children&rsquo;s Medical Services</li>\r\n<li class=\"BodyA\">South Florida Community Care Network</li>\r\n<li class=\"BodyA\">Ask for age limit and Medicaid</li>\r\n</ul>\r\n<p class=\"BodyA\"><strong>Dental Services include:</strong></p>\r\n<ul>\r\n<li class=\"BodyA\"><strong>Examinations</strong></li>\r\n<li class=\"BodyA\"><strong>Cleanings</strong></li>\r\n<li class=\"BodyA\"><strong>Tooth Sealants</strong></li>\r\n<li class=\"BodyA\"><strong>Fillings</strong></li>\r\n<li class=\"BodyA\"><strong>Fluoride Treatments</strong></li>\r\n<li class=\"BodyA\"><strong>Simple Extractions</strong></li>\r\n<li class=\"BodyA\"><strong>SAME DAY EMERGENCY VISITS ALSO AVAILABLE</strong></li>\r\n</ul>\r\n<p class=\"BodyA\"></p>\r\n<p class=\"BodyA\"><strong>Children - </strong>(especially those in the Head Start and Early Head Start Programs) - Any child age 4 to 18 years of age who meets the economic eligibility guidelines may receive services; Medicaid is also accepted.</p>\r\n<p class=\"NormalWeb1\"><strong>Ryan White Program - </strong>The Health Department is the lead agency for the Ryan White Care Act Dental Services and provides services at four clinical locations for those who qualify. Three of the sites serve adults and the fourth site serves children under age 18, as well as the caregivers of the child who receives Ryan White services. In addition to clinical services, clients may be referred as necessary to Nova Southeastern University Dental School or the Nova Southeastern University Oral Surgeon at Broward General Medical Center.</p>\r\n<p class=\"BodyA\"><strong>Adults - </strong>The Health Department provides preventive and limited routine dental care for eligible adults referred to the clinic through the Memorial Healthcare System Primary Care Program. The Primary Care Physician makes a referral based on pre-established criteria. The patient referral must come from Memorial Healthcare System Primary Care Program. Preventive and limited routine dental care for eligible adults is also available at the Broward College Dental Clinic.</p>\r\n<p class=\"BodyA\"><strong>Is there a cost for services? - </strong>Services are provided on a sliding scale based on income.&nbsp; Some services are free of charge. The charge for any procedure is decided once all eligibility paperwork is filled out. We also accept patients enrolled in the Children&rsquo;s Medical Services Program and the South Florida Community Care Network.</p>\r\n<p align=\"center\"><strong><em><span style=\"text-decoration: underline;\">Other Dental Service Providers</span></em></strong></p>\r\n<p><strong>Colleges and Universities Dental Clinics - </strong>The Dental Assistant and Hygiene Programs at Colleges offer full services for dental hygiene and limited services for other dental procedures. It is open to the public by appointment only. Clinic hours vary each semester so please call the clinic for information and to schedule an appointment.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Broward County Dental Association - </strong>Provides callers with referrals to qualified dentists in their area who offer both general and specialized services.</p>\r\n<p class=\"BodyA\" style=\"text-align: left;\" align=\"center\"><strong>&nbsp;</strong></p>',5,86,'','','',1);
